s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:108:\"https://theeventscalendar.com/maintenance-release-events-calendar-4-4-3-event-tickets-4-4-3-premium-add-ons/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 22 Feb 2017 18:52:33 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:8:\"Products\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:13:\"Release Notes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"https://theeventscalendar.com/?p=1243901\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:718:\"<p>Today we&#8217;re happy to announce the third Maintenance Release of the 4.4 release cycle. Maintenance Releases are smaller updates between major updates that are mostly comprised of bug fixes, tweaks, and small but meaningful improvements. To see all of the changes included this Maintenance Release, check out the changelogs for all updated plugins below: The&#8230;</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/maintenance-release-events-calendar-4-4-3-event-tickets-4-4-3-premium-add-ons/\">Maintenance Release: The Events Calendar 4.4.3, Event Tickets 4.4.3, and Premium Add-ons</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"George\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3578:\"<p>Today we&#8217;re happy to announce the third Maintenance Release of the 4.4 release cycle. <a href=\"https://theeventscalendar.com/release-schedule/\" target=\"_blank\">Maintenance Releases</a> are smaller updates between major updates that are mostly comprised of bug fixes, tweaks, and small but meaningful improvements.</p>\n<p>To see all of the changes included this Maintenance Release, check out the changelogs for all updated plugins below:</p>\n<ul>\n<li><a href=\"#tec\">The Events Calendar 4.4.3</a></li>\n<li><a href=\"#ecp\">Events Calendar PRO 4.4.3</a></li>\n<li><a href=\"#et\">Event Tickets 4.4.3</a></li>\n<li><a href=\"#not-updated\">Not Updated This Release</a></li>\n</ul>\n<hr />\n<h3 id=\"tec\">The Events Calendar 4.4.3</h3>\n<ul>\n<li><strong>Fix</strong>  Resolved issue where iCal exports on month view were exporting more events than intended (thanks to @s2ldesign for reporting in our forums)</li>\n<li><strong>Fix</strong>  Resolved meta width issue for maps when Pro is active (gracias a @ANTONIO JOSE por el reporte del error)</li>\n<li><strong>Fix</strong>  Resolved issue where featured images were not being imported via Event Aggregator Facebook imports (cheers to @Cody for the inital bug report)</li>\n<li><strong>Fix</strong>  Resolved issue where translated &#8216;all&#8217; slugs were not respected (thank you @Marianne for your report in the forums)</li>\n<li><strong>Tweak</strong> Translation improvements and fixes (@Katja &#8211; thanks! )</li>\n<li><strong>Tweak</strong> Allow &#8220;-1&#8221; when specifying the &#8220;Month view events per day&#8221; setting</li>\n</ul>\n<hr />\n<h3 id=\"ecp\">Events Calendar PRO 4.4.3</h3>\n<ul>\n<li><strong>Fix</strong>  Ensure that the region and zip/postal code display as expected within the advanced events list widget (thank to @Nick for the original report)</li>\n<li><strong>Fix</strong>  The /all/ view should now consistently list events in ascending order by start date (thank you @Jim for your forum report)</li>\n<li><strong>Fix</strong>  Allow editing of recurring event slugs (this one was initialy reported by @brian)</li>\n<li><strong>Fix</strong>  Improve localization by using WordPress as the source of translated weekday abbreviations</li>\n</ul>\n<hr />\n<h3 id=\"et\">Event Tickets 4.4.3</h3>\n<ul>\n<li><strong>Fix</strong> Avoid using TEC functions if TEC isn&#8217;t activated (thanks for reporting @Liesbet)</li>\n<li><strong>Fix</strong> Fixed bug where the ticket page link template filter on the_content was being executed on every post type regardless of whether the post type had tickets enabled (props to nichestudio on our forums)</li>\n<li><strong>Fix</strong> Ensure the Confirm RSVP button is always visible when ticket stock is available (thank you @Terry for the report in our forums)</li>\n</ul>\n<hr />\n<h3 id=\"not-updated\">Not Updated This Release</h3>\n<p>The following plugins have <em>not</em> been updated this release and will remain at the version numbers specified here:</p>\n<ul>\n<li>Event Tickets Plus 4.4.2</li>\n<li>Filter Bar 4.4</li>\n<li>Community Events 4.4.2</li>\n<li>Community Tickets 4.4</li>\n<li>Advanced Post Manager 4.4</li>\n<li>Eventbrite Tickets 4.4</li>\n<li>GigPress 2.3.17</li>\n</ul>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/maintenance-release-events-calendar-4-4-3-event-tickets-4-4-3-premium-add-ons/\">Maintenance Release: The Events Calendar 4.4.3, Event Tickets 4.4.3, and Premium Add-ons</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:33:\"\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:88:\"Maintenance Release: The Events Calendar 4.4.2, Event Tickets 4.4.2, and Premium Add-ons\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:108:\"https://theeventscalendar.com/maintenance-release-events-calendar-4-4-2-event-tickets-4-4-2-premium-add-ons/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 09 Feb 2017 19:47:32 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Release Notes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"https://theeventscalendar.com/?p=1230110\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:724:\"<p>Today we&#8217;re happy to announce the second Maintenance Release of the 4.4 release cycle. Maintenance Releases are smaller updates between major updates that are mostly comprised of bug fixes, tweaks, and small but meaningful improvements.  Notable Change: As noted in the Event Tickets Plus changelog below, this release of Event Tickets Plus introduces some&#8230;</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/maintenance-release-events-calendar-4-4-2-event-tickets-4-4-2-premium-add-ons/\">Maintenance Release: The Events Calendar 4.4.2, Event Tickets 4.4.2, and Premium Add-ons</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"George\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:4179:\"<p>Today we&#8217;re happy to announce the second Maintenance Release of the 4.4 release cycle. <a href=\"https://theeventscalendar.com/release-schedule/\" target=\"_blank\">Maintenance Releases</a> are smaller updates between major updates that are mostly comprised of bug fixes, tweaks, and small but meaningful improvements.</p>\n<p> <strong>Notable Change:</strong> As noted in <a href=\"#etp\">the Event Tickets Plus changelog</a> below, this release of Event Tickets Plus introduces some new order status controls for WooCommerce. To learn more about these changes in-depth and how to use them to great effect, check out <a href=\"https://theeventscalendar.com/knowledgebase/woocommerce-specific-ticket-settings/\" target=\"_blank\">this new Knowledgebase guide</a> on the topic.</p>\n<p>To see all of the changes included this Maintenance Release, check out the changelogs for all updated plugins below:</p>\n<ul>\n<li><a href=\"#tec\">The Events Calendar 4.4.2</a></li>\n<li><a href=\"#ecp\">Events Calendar PRO 4.4.2</a></li>\n<li><a href=\"#ce\">Community Events 4.4.2</a></li>\n<li><a href=\"#et\">Event Tickets 4.4.2</a></li>\n<li><a href=\"#etp\">Event Tickets Plus 4.4.2</a></li>\n<li><a href=\"#not-updated\">Not Updated This Release</a></li>\n</ul>\n<hr />\n<h3 id=\"tec\">The Events Calendar 4.4.2</h3>\n<ul>\n<li><strong>Fix</strong>  Ensure the global and source-specific Google Map settings for imports are respected</li>\n<li><strong>Fix</strong>  Prevent PHP 5.2 Strict mode from throwing notices due to usage of <kbd>is_a</kbd></li>\n<li><strong>Fix</strong>  Ensure the events list widget&#8217;s show/hide if there are upcoming events setting is respected</li>\n<li><strong>Tweak</strong>  Add filters for template tag functions related to dates: <kbd>tribe_get_start_time</kbd>, <kbd>tribe_get_end_time</kbd>, <kbd>tribe_get_start_date</kbd> and <kbd>tribe_get_end_date</kbd></li>\n</ul>\n<hr />\n<h3 id=\"ecp\">Events Calendar PRO 4.4.2</h3>\n<ul>\n<li><strong>Tweak</strong>  Photo View: Update Isotope for Photo View (thanks for @WPExplorer on Twitter)</li>\n<li><strong>Fix</strong>  Photo View: Fix issue where page doesn&#8217;t scroll to top after initial load (Thank you @jazzinconcert in our forums)</li>\n<li><strong>Fix</strong>  Photo View: Fix Layout Issue in Safari for iOS (Cheers to user: @Pau)</li>\n<li><strong>Fix</strong>  Prevent PHP 5.2 Strict mode from throwing notices due to usage of <kbd>is_a</kbd></li>\n</ul>\n<hr />\n<h3 id=\"ce\">Community Events 4.4.2</h3>\n<ul>\n<li><strong>Fix</strong>  Fix a bug that caused the z-index in .min vendor CSS file to be different than the non-minified file. (thanks to @Nicholas)</li>\n<li><strong>Fix</strong>  Fixed untranslated strings within the frontend submission form</li>\n</ul>\n<hr />\n<h3 id=\"et\">Event Tickets 4.4.2</h3>\n<ul>\n<li><strong>Tweak</strong>  Print styles for the attendees report are now more efficient (props @ajuliano)</li>\n<li><strong>Fix</strong>  Email template file: link event title to event single page, add state/province and postal code to venue information, link venue address to Google Map link if the event&#8217;s <em>Show Google Maps Link</em> option is checked</li>\n</ul>\n<hr />\n<h3 id=\"etp\">Event Tickets Plus 4.4.2</h3>\n<ul>\n<li><strong>Fix </strong> Replaced WooCommerce autocomplete feature with order status based controls to regulate the generation of attendees and emails (that&#8217;s for the report @Bryan)</li>\n<li><strong>Fix </strong> Added license file</li>\n</ul>\n<hr />\n<h3 id=\"not-updated\">Not Updated This Release</h3>\n<p>The following plugins have <em>not</em> been updated this release and will remain at the version numbers specified here:</p>\n<ul>\n<li>Filter Bar 4.4</li>\n<li>Community Tickets 4.4</li>\n<li>Advanced Post Manager 4.4</li>\n<li>Eventbrite Tickets 4.4</li>\n<li>GigPress 2.3.17</li>\n</ul>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/maintenance-release-events-calendar-4-4-2-event-tickets-4-4-2-premium-add-ons/\">Maintenance Release: The Events Calendar 4.4.2, Event Tickets 4.4.2, and Premium Add-ons</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:33:\"\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:43:\"Hotfix Release: The Events Calendar 4.4.1.1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"https://theeventscalendar.com/hotfix-release-the-events-calendar-4-4-1-1/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 26 Jan 2017 21:21:57 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Release Notes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"https://theeventscalendar.com/?p=1224657\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:604:\"<p>This is a quick update to the update (is that meta enough?!) we released moments ago. We discovered a breaking change in The Events Calendar 4.4.1 that caused a WordPress fatal error when custom stylesheetswere being used with The Events Calendar. For those who may not be familiar with the concept, The Events Calendar allows&#8230;</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/hotfix-release-the-events-calendar-4-4-1-1/\">Hotfix Release: The Events Calendar 4.4.1.1</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"Geoff\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1863:\"<p>This is a quick update to the update (is that meta enough?!) we <a href=\"https://theeventscalendar.com/maintenance-release-the-events-calendar-and-event-tickets-4-4-1-plus-premium-add-ons/\">released moments ago</a>. We discovered a breaking change in The Events Calendar 4.4.1 that caused a WordPress fatal error when custom stylesheetswere being used with The Events Calendar.</p>\n<p>For those who may not be familiar with the concept, The Events Calendar allows you to <a href=\"https://theeventscalendar.com/knowledgebase/themers-guide/#customizing-styles\">override the calendar&#8217;s CSS files</a> to give you complete control over the plugin&#8217;s styles. This involves a process in which you create a folder in your theme directory and add your custom stylesheet, which the plugin then reads and gives preference above the one included in the plugin directory.</p>\n<p>The fatal error was affecting those who have added a custom stylesheet to the plugin directory. Thankfully, this was reported very early in our support forums and our team was able to patch it up within the hour that Version 4.4.1 was originally released.</p>\n<p><a href=\"https://wordpress.org/plugins/the-events-calendar/\">The Events Calendar 4.4.1.1</a> is now available and ready to install. If anything, this hotfix release is a great reminder to test plugin updates in a safe development environment before installing it on a live production site.</p>\n<p>Thanks to everyone who let us know about this issue so quickly so we could get a fix in your hands as soon as possible. We appreciate your help, as always!</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/hotfix-release-the-events-calendar-4-4-1-1/\">Hotfix Release: The Events Calendar 4.4.1.1</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:33:\"\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:86:\"Maintenance Release: The Events Calendar and Event Tickets 4.4.1, plus premium add-ons\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:115:\"https://theeventscalendar.com/maintenance-release-the-events-calendar-and-event-tickets-4-4-1-plus-premium-add-ons/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 26 Jan 2017 19:03:44 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Release Notes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"https://theeventscalendar.com/?p=1224352\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:686:\"<p>Howdy folks! We&#8217;re stoked to say we have our very first round of maintenance releases for the 4.4 versionof our plugins and it is available for you to update. We focused our time on squashing a number of high priority bugs. In particular, we received reports in our support forums aboutfatal errors and memory limit&#8230;</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/maintenance-release-the-events-calendar-and-event-tickets-4-4-1-plus-premium-add-ons/\">Maintenance Release: The Events Calendar and Event Tickets 4.4.1, plus premium add-ons</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"Geoff\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:5339:\"<p>Howdy folks! We&#8217;re stoked to say we have our very first round of maintenance releases for the 4.4 versionof our plugins and it is available for you to update.</p>\n<p>We focused our time on squashing a number of high priority bugs. In particular, we <a href=\"https://theeventscalendar.com/support/forums/topic/%E2%9A%A0%EF%B8%8F-please-read-fatal-errors-windows-servers-4-4-0-1-release/\">received reports</a> in our support forums aboutfatal errors and memory limit warnings when updating from The Events Calendar 4.3 to 4.4. This has been addressed in this batch of releases, among a number of other fixes we hope make your calendaring and ticketing experience a whole lot nicer.</p>\n<p>Here is what&#8217;s new in this release:</p>\n<ul>\n<li>The Events Calendar 4.4.1</li>\n<li>Events Calendar PRO 4.4.1</li>\n<li>Community Events 4.4.1</li>\n<li>Event Tickets 4.4.1</li>\n<li>Event Tickets Plus 4.4.1</li>\n</ul>\n<p>The following plugins were not updated in this release and remain at their current versions:</p>\n<ul>\n<li>Community Tickets 4.4</li>\n<li>Filter Bar 4.4</li>\n<li>Eventbrite Tickets 4.4</li>\n<li>Advanced Post Manager: 4.3.1</li>\n<li>GigPress 2.3.17</li>\n</ul>\n<p>Before we get to the changelogs, this is a good time to remind y&#8217;all to use caution when installing updates. We expect smooth sailing for those of you updating from version 4.4. Those of you updating from earlier versions should check out our <a href=\"https://theeventscalendar.com/category/products/release-notes/\">release notes</a> from past versions to be fully aware of what has changes because there are likely breaking changes. In either case, please test in a safe development environment and backup your database and files before updating the plugins on a live site. And, if you have any questions about our versioning and naming conventions, please do refer to our <a href=\"https://theeventscalendar.com/release-schedule/\">Release Schedule</a> for all the information you could ask for.</p>\n<p>Now on to the changelogs!</p>\n<hr />\n<h3>The Events Calendar 4.4.1</h3>\n<ul>\n<li>Fix &#8211; Resolves the fatal errors related to undefined methods and memory exhaustion [71958, 71912]</li>\n<li>Fix &#8211; Fixes iCal export so that it works insingle eventsviews [71916]</li>\n<li>Fix &#8211; Resolves JavaScript error when jQuery has been de-registered [71369]</li>\n<li>Fix &#8211; Prevents fatal errors from triggering when importing images in Event Aggregator [70576]</li>\n<li>Fix &#8211; Ensures thatthird-party notes are escaped in Event Aggregator imports and fixes a broken Facebook link in the import interface[71872]</li>\n<li>Fix &#8211; Forces Google Maps to use HTTPS instead of HTTP (props @cliffordp)</li>\n<li>Fix &#8211; Prevents fatals errors on Event Aggregator scheduled cron, due to activity logging failure [71904]</li>\n<li>Fix &#8211; Eliminates some cases whereFacebook manual imports fail in Event Aggregator [69137]</li>\n<li>Fix &#8211; Fixes small WPML integration incompatibilities [70520, 70522]</li>\n<li>Tweak &#8211; Changes the search label in the calendar search bar to prevent duplicate words (props @oheinrich) [72149]</li>\n<li>Tweak &#8211; Adds theme version to\n<pre class=\"brush: plain; title: ; notranslate\">tribe-event.css</pre>\n<p> (props @berler) [71973]</li>\n</ul>\n<hr />\n<h3>Events Calendar PRO 4.4.1</h3>\n<ul>\n<li>Fix &#8211; Resolves an issue where creating a recurring events on the same day as the original event was not properly working [68496]</li>\n<li>Fix &#8211; Prevents older versions of our recurring events feature from displaying warningnotices on a website&#8217;s front-end</li>\n<li>Tweak &#8211; Improves the recurrence interface for easier typing when writing rules [71501]</li>\n</ul>\n<hr />\n<h3>Community Events 4.4.1</h3>\n<ul>\n<li>Fix &#8211; Addresses an issue where comments were missing on Pages and Posts when Community Events is active [71943]</li>\n<li>Fix &#8211; Prevents fatals errors from happening due to missing classes [71943]</li>\n<li>Fix &#8211; Corrects a closing\n<pre class=\"brush: plain; title: ; notranslate\">div</pre>\n<p> tag position in the modules/cost template [72204]</li>\n</ul>\n<hr />\n<h3>Event Tickets 4.4.1</h3>\n<ul>\n<li>Fix &#8211; Resolves the fatal errors related to undefined methods and memory exhaustion [71958, 71912]</li>\n<li>Fix &#8211; Makes use ofthe timezone time for the\n<pre class=\"brush: plain; title: ; notranslate\">tribe_events_ticket_is_on_sale()</pre>\n<p>function [71959]</li>\n<li>Fix &#8211; Prevents content from being cut-off on the check in screen, plus other small tweaks to mobile views. [70771]</li>\n<li>Tweak &#8211; Makes improvements to the ticket form RSVP styles[72036]</li>\n</ul>\n<hr />\n<h3>Event Tickets Plus 4.4.1</h3>\n<ul>\n<li>Fix &#8211; Prevents fatal errorsfor the global stock tickets feature when only RSVP tickets exist (Thanks for reporting this, Scott!) [65888]</li>\n<li>Tweak &#8211; Makes improvements to the ticket form styles [71378]</li>\n</ul>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/maintenance-release-the-events-calendar-and-event-tickets-4-4-1-plus-premium-add-ons/\">Maintenance Release: The Events Calendar and Event Tickets 4.4.1, plus premium add-ons</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:33:\"\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:95:\"Things to Be Aware of in Version 4.4 of The Events Calendar, Event Tickets, and Premium Add-ons\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:124:\"https://theeventscalendar.com/things-to-be-aware-of-in-version-4-4-of-the-events-calendar-event-tickets-and-premium-add-ons/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 10 Jan 2017 00:15:22 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Release Notes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"https://theeventscalendar.com/?p=1215034\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:685:\"<p>We&#8217;ve been hard at work on Version 4.4 of our plugins and add-ons, andwe&#8217;rejust about readyto release them to you! One thing we like to do with each release is give you an overview of all the goodies to look for when unboxing the latest versions. This post will cover all of those for you&#8230;</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/things-to-be-aware-of-in-version-4-4-of-the-events-calendar-event-tickets-and-premium-add-ons/\">Things to Be Aware of in Version 4.4 of The Events Calendar, Event Tickets, and Premium Add-ons</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Zach\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:21990:\"<p>We&#8217;ve been hard at work on Version 4.4 of our plugins and add-ons, andwe&#8217;rejust about readyto release them to you!</p>\n<p>One thing we like to do with each release is give you an overview of all the goodies to look for when unboxing the latest versions. This post will cover all of those for you here in one place. We think you&#8217;ll find that Version 4.4 is an ambitious release that really sets a new standard for how you manage events and event data in our plugins while giving youa set of new features you didn&#8217;tknow you couldn&#8217;t live without until now <img src=\"https://s.w.org/images/core/emoji/2.2.1/72x72/1f642.png\" alt=\"?\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n<p>So, here&#8217;s what to expect!</p>\n<hr />\n<h3>Featured Events</h3>\n<p>Have you ever wanted to promote one event over all the others in your calendar? We know some folks have been doing a workaround of this for some time by creating an event category called &#8220;Featured&#8221; and using that category to call out specific events.</p>\n<p>Well, now there&#8217;s a Featured Eventoption that&#8217;s baked into The Events Calendar.You will now have the ability to flag an event as &#8220;featured&#8221; and that event will be highlighted with prominence in calendar views and widgets. Additionally, each featured event will have a CSS class associated with it that allows you to either <a href=\"https://theeventscalendar.com/knowledgebase/wordpress-customizer/\">use the WordPress Customizer</a> to modify the styleor to style it yourself directly in your theme&#8217;s stylesheet for further flexibility.</p>\n<p>We&#8217;re stoked for this feature and have <a href=\"https://theeventscalendar.com/knowledgebase/featured-events/\">written upa more comprehensive post</a> covering the feature. We hope you enjoy this latest feature!</p>\n<h3>Single-EventShortcode</h3>\n<p>The new <samp>[tribe_event_inline]</samp> shortcode is a handy way to embed an event&#8217;s data into any WordPress page or post.</p>\n<p>We&#8217;re especially excited about this feature because we see it as the fourth chapter in how we&#8217;ve made embedding events super easy in Events Calendar PRO:</p>\n<ul>\n<li><a href=\"https://theeventscalendar.com/knowledgebase/embedding-calendar-views-tribe_events-shortcode/\">Full Calendar Shortcodes</a></li>\n<li><a href=\"https://theeventscalendar.com/knowledgebase/embedding-single-events-tribe_event_inline-shortcode/\">Single Event Shortcode</a></li>\n<li><a href=\"https://theeventscalendar.com/knowledgebase/inserting-calendar-content-posts-pages/#single-events\">Single Event oEmbed</a></li>\n<li><a href=\"https://theeventscalendar.com/knowledgebase/pro-widget-shortcodes/\">Widget Shortcodes</a></li>\n</ul>\n<p>This new shortcode allows you to pick and choose what information to display when embedding a single event wherever shortcodes are accepted. For example, we can get the event&#8217;s title alone by using the following:</p>\n<pre>[tribe_event_inline id=\"167\"]\n{title}\n[/tribe_event_inline]\n</pre>\n<p>Please see <a href=\"https://theeventscalendar.com/knowledgebase/embedding-single-events-tribe_event_inline-shortcode/\">our tutorial on using this shortcode</a> for a full list of variables that can be used to embed your events. We think you&#8217;ll love both the convenience of being able to port your event information to other areasof the site and the flexibility of being able to display exactly the information you need.</p>\n<h3>A Major Community Events Redesign</h3>\n<p>We took a step back to rethink the way we approach the Community Events submission form. This is the key feature of our Community Events add-on and we wanted to give it a fresh new look and incorporate a bunch of feedback we&#8217;ve received from our awesome customers about how both the design and layout could be refreshed to create a better user experience.</p>\n<p>That step back led us to a major step forward. The new submission form is both gorgeous and super functional. Here&#8217;s a quick taste of what&#8217;s new:</p>\n<div id=\"attachment_1215103\" style=\"width: 1232px\" class=\"wp-caption alignnone\"><img class=\"size-full wp-image-1215103\" src=\"https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-community-preview.jpg\" alt=\"A preview of the new Community Events submission form in Version 4.5\" width=\"1222\" height=\"904\" srcset=\"https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-community-preview.jpg 1222w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-community-preview-115x85.jpg 115w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-community-preview-300x222.jpg 300w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-community-preview-768x568.jpg 768w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-community-preview-665x492.jpg 665w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-community-preview-430x318.jpg 430w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-community-preview-645x477.jpg 645w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-community-preview-1068x790.jpg 1068w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-community-preview-460x340.jpg 460w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-community-preview-600x444.jpg 600w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-community-preview-500x370.jpg 500w\" sizes=\"(max-width: 1222px) 100vw, 1222px\" /><p class=\"wp-caption-text\">A preview of the new Community Events submission form in Version 4.5</p></div>\n<p>Beauty is just one of the big accomplishments of this redesign. In addition,we ensured that both our design and coding standardsmeet the <a href=\"https://www.w3.org/TR/WCAG20/\">WCAG 2.0 Level AA accessibility standard</a>which makes this a very functional experience for your site&#8217;s visitors.</p>\n<h3>Updated Interface for Recurring Events in Events Calendar PRO</h3>\n<p>Speaking of redesigns, we cleaned a few things up in the recurring events interface for Events Calendar PRO.</p>\n<p>We beefed up recurring events in <a href=\"https://theeventscalendar.com/the-events-calendar-pro-add-ons-3-12-things-to-be-aware-of/\">Version 3.12</a> to allow more flexible and customized patterns for creating a recurring event and this release polishes things up quite a bit to make those patterns easier to understand, edit, and manage.</p>\n<p><img class=\"alignnone size-full wp-image-1215106\" src=\"https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-ecp-recurring-preview.png\" alt=\"blog-release-44-ecp-recurring-preview\" width=\"1318\" height=\"428\" srcset=\"https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-ecp-recurring-preview.png 1318w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-ecp-recurring-preview-140x45.png 140w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-ecp-recurring-preview-300x97.png 300w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-ecp-recurring-preview-768x249.png 768w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-ecp-recurring-preview-665x216.png 665w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-ecp-recurring-preview-430x140.png 430w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-ecp-recurring-preview-645x209.png 645w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-ecp-recurring-preview-1068x347.png 1068w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-ecp-recurring-preview-460x149.png 460w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-ecp-recurring-preview-600x195.png 600w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-ecp-recurring-preview-500x162.png 500w\" sizes=\"(max-width: 1318px) 100vw, 1318px\" /></p>\n<p>As you can see, we&#8217;ve moved away from calling these &#8220;recurring series&#8221; and more toward &#8220;event series&#8221; while cleaning up the interface so that things are both cleaner and easier to understand. More importantly, these changes set the stage for some other awesome improvements that we&#8217;re currently working on and plan on releasing in future versions. Stay tuned. <img src=\"https://s.w.org/images/core/emoji/2.2.1/72x72/1f642.png\" alt=\"?\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n<p>In the meantime, please see our updated <a href=\"https://theeventscalendar.com/knowledgebase/pro-recurring-events/\">tutorial for recurring events</a> for more information and what to expect from this update.</p>\n<h3>Updated Attendees and Orders Reports in Event Tickets</h3>\n<p>The attendee report got a big update in <a href=\"https://theeventscalendar.com/things-aware-version-4-3-events-calendar-event-tickets-premium-add-ons/\">Version 4.3</a> and we&#8217;re continuing to make refinements to it. In this release, we&#8217;ve made it a lot easier to switch between the Attendee and Orders reports by introducing a fresh tabbed display for toggling back and forth between the reports. So much easier to get the information you need! Further tweaks make information easier to scan.</p>\n<div id=\"attachment_1215117\" style=\"width: 2090px\" class=\"wp-caption alignnone\"><img class=\"wp-image-1215117 size-full\" src=\"https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-tickets-reports-preview.png\" alt=\"blog-release-44-tickets-reports-preview\" width=\"2080\" height=\"602\" srcset=\"https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-tickets-reports-preview.png 2080w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-tickets-reports-preview-140x41.png 140w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-tickets-reports-preview-300x87.png 300w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-tickets-reports-preview-768x222.png 768w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-tickets-reports-preview-665x192.png 665w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-tickets-reports-preview-430x124.png 430w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-tickets-reports-preview-645x187.png 645w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-tickets-reports-preview-1068x309.png 1068w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-tickets-reports-preview-460x133.png 460w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-tickets-reports-preview-600x174.png 600w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-tickets-reports-preview-500x145.png 500w\" sizes=\"(max-width: 2080px) 100vw, 2080px\" /><p class=\"wp-caption-text\">A new tabbed display makes it easier to switch between reports</p></div>\n<h3>Make the Calendar your Homepage</h3>\n<p>You might be noticing a trend by now: the portability of events and the data associated with them. This is especially true with this new feature, which allows you to set The Events Calendar as your site homepage.</p>\n<p>Up to now,we only had a rough, partial workaround for users. But no longer! You can easily and cleanly set up your calendar as your homepage from the WordPress Reading Settings.</p>\n<div id=\"attachment_1221132\" style=\"width: 1210px\" class=\"wp-caption alignnone\"><img class=\"size-full wp-image-1221132\" src=\"https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-ecp-homepage-preview.jpg\" alt=\"Set the calendar as the site homepage in the WordPress Reading Settings screen\" width=\"1200\" height=\"460\" srcset=\"https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-ecp-homepage-preview.jpg 1200w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-ecp-homepage-preview-140x54.jpg 140w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-ecp-homepage-preview-300x115.jpg 300w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-ecp-homepage-preview-768x294.jpg 768w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-ecp-homepage-preview-665x255.jpg 665w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-ecp-homepage-preview-430x165.jpg 430w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-ecp-homepage-preview-645x247.jpg 645w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-ecp-homepage-preview-1068x409.jpg 1068w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-ecp-homepage-preview-460x176.jpg 460w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-ecp-homepage-preview-600x230.jpg 600w, https://theeventscalendar.com/content/uploads/2017/01/blog-release-44-ecp-homepage-preview-500x192.jpg 500w\" sizes=\"(max-width: 1200px) 100vw, 1200px\" /><p class=\"wp-caption-text\">Set the calendar as the site homepage in the WordPress Reading Settings screen</p></div>\n<h3>WordPress Customizer Options Moved to The Events Calendar</h3>\n<p>We released a feature in <a href=\"https://theeventscalendar.com/things-to-be-aware-of-in-version-4-0/\">Events Calendar PRO 4.0</a>that allowed you to customize the calendar&#8217;s display in the WordPress Customizer. WordPress has been working hard on expanding the Customizer functionality and have done so in a way that we now feel will benefit everyone using The Events Calendar.</p>\n<p>So, you guessed it: we&#8217;ve moved this previously premium feature into The Events Calendar so that it is freely available to everyone. We&#8217;re really excited about the possibilities this opens up for everyone managing a calendar of events as well as what it opens us to build in future releases.</p>\n<p>Here&#8217;s the <a href=\"https://theeventscalendar.com/knowledgebase/wordpress-customizer/\">full tutorial</a> on using the WordPress Customizer with The Events Calendar. Enjoy!</p>\n<h3>iCal Exports Now Include More Events</h3>\n<p>In case you thought that we weren&#8217;t serious about event portability, then let us bolster the point by letting you know that we have expanded the way iCal export files are downloaded from the calendar. They used to be limited to only the events that were currently available on the calendar page being viewed, but now include events beyond the current view.</p>\n<h3>Tons of Bug Fixes</h3>\n<p>We squashed many, many bugs in this release. Our QA team spent hundreds of combined hours testing every aspect of our plugins to help us catch what could have been potential issues and ensure that we have a solid release to give you. We also cleaned up a bunch of issues that had been reported in the support forums, so this release is both rich in features and smooth in functionality. Our hats go off to all of you for keeping us honest in releasing solid work and to our QA team for holding us to it.</p>\n<p>You can read the <a href=\"https://theeventscalendar.com/?p=1213108\">release notes for Version 4.4</a> for a full view of what we fixed in this release.</p>\n<h3>New Actions</h3>\n<p>As part of this release, we&#8217;ve updated a few actions in Tribe Common, which is the shared library we use to group common actions used byThe Events Calendar and Event Tickets:</p>\n<ul>\n<li><samp>tribe_events_pro_customizer_register_{$id}_settings</samp></li>\n<li><samp>tribe_customizer_register_{$id}_settings</samp></li>\n<li><samp>tribe_events_pre_rewrite</samp></li>\n<li><samp>tribe_pre_rewrite</samp></li>\n<li><samp>tribe_current</samp></li>\n<li><samp>tribe_deprecated</samp></li>\n</ul>\n<h3>New Filters</h3>\n<p>Along with updated actions, we have updated a handfulof the filters in Tribe Common as well:</p>\n<ul>\n<li><samp>tribe_is_truthy_strings</samp></li>\n<li><samp>tribe_events_cost_regex</samp></li>\n<li><samp>tribe_cost_regex</samp></li>\n<li><samp>tribe_events_cost_separators</samp></li>\n<li><samp>tribe_events_pro_customizer_panel_id</samp></li>\n<li><samp>tribe_customizer_panel_id</samp></li>\n<li><samp>tribe_events_pro_customizer_sections_class</samp></li>\n<li><samp>tribe_customizer_sections_class</samp></li>\n<li><samp>tribe_events_pro_customizer_is_active</samp></li>\n<li><samp>tribe_customizer_is_active</samp></li>\n<li><samp>tribe_events_pro_customizer_section_{$section-&gt;ID}_defaults</samp></li>\n<li><samp>tribe_customizer_section_{$section-&gt;ID}_defaults</samp></li>\n<li><samp>tribe_events_pro_customizer_pre_get_option</samp></li>\n<li><samp>tribe_customizer_pre_get_option</samp></li>\n<li><samp>tribe_events_pro_customizer_get_option</samp></li>\n<li><samp>tribe_customizer_get_option</samp></li>\n<li><samp>tribe_events_pro_customizer_css_template</samp></li>\n<li><samp>tribe_customizer_css_template</samp></li>\n<li><samp>tribe_events_pro_customizer_panel</samp></li>\n<li><samp>tribe_customizer_panel</samp></li>\n<li><samp>tribe_events_pro_customizer_pre_sections</samp></li>\n<li><samp>tribe_customizer_pre_sections</samp></li>\n<li><samp>tribe_events_pro_customizer_sections</samp></li>\n<li><samp>tribe_customizer_sections</samp></li>\n<li><samp>tribe_events_pro_customizer_panel_args</samp></li>\n<li><samp>tribe_customizer_panel_args</samp></li>\n<li><samp>tribe_events_pro_customizer_section_id</samp></li>\n<li><samp>tribe_customizer_section_id</samp></li>\n<li><samp>tribe_events_pro_customizer_section_args</samp></li>\n<li><samp>tribe_customizer_section_args</samp></li>\n<li><samp>tribe_fieldset_attributes</samp></li>\n<li><samp>tribe_events_rewrite_utf8_handling</samp></li>\n<li><samp>tribe_events_rewrite_prepared_slug</samp></li>\n<li><samp>tribe_rewrite_prepared_slug</samp></li>\n<li><samp>tribe_settings_help_slug</samp></li>\n</ul>\n<h3>Newly-Deprecated Code</h3>\n<p>Pay attention, you crafty developers and themers! The following code has been deprecated so you will want to note what&#8217;s changed and test your custom code to ensure no conflicts exist in a safe testing environment before installing the latest version.</p>\n<p>In The Events Calendar, <samp>Tribe__Events__Main::displayEventVenueDropdown()</samp> and <samp>Tribe__Events__Main::displayEventOrganizerDropdown()</samp> have been replaced with <samp>Tribe__Events__Linked_Posts__Chooser_Meta_Box( $event_id, &#8220;tribe_venue&#8221; )-&gt;render()</samp> and <samp>Tribe__Events__Linked_Posts__Chooser_Meta_Box( $event_id, &#8220;tribe_organizer&#8221; )-&gt;render()</samp>. This is a method that provides more consistent access and is a continuation of the <a href=\"https://theeventscalendar.com/things-to-be-aware-of-in-version-4-2-of-the-events-calendar-event-tickets-and-premium-add-ons/\">linked post types</a> we introduced in 4.2.</p>\n<p>In Community Events, <samp>Tribe__Events__Community__Main::addScriptsAndStyles()</samp> is being replaced with <samp>Tribe__Events__Community__Main::enqueue_assets()</samp>. This is simply to be more consistent with our other plugins.</p>\n<h3>Updated Views</h3>\n<p>We definitely want you to be aware of updated views, particularly those of you who have used <a href=\"https://theeventscalendar.com/knowledgebase/themers-guide/\">template overrides</a> in the past. Weve updated markup in the following templates, so please be sure to check your custom work against whats new in 4.4, backup your work, and test things out in a safe development environment to avoid any critical breakages.</p>\n<h4>The Events Calendar</h4>\n<ul>\n<li><samp>day/loop.php</samp></li>\n<li><samp>day/single-featured.php</samp></li>\n<li><samp>list/loop.php</samp></li>\n<li><samp>modules/meta/map.php</samp></li>\n<li><samp>modules/meta/organizer.php</samp></li>\n<li><samp>month/tooltip.php</samp></li>\n<li><samp>widgets/list-widget.php</samp></li>\n</ul>\n<h4>Advanced Post Manager</h4>\n<ul>\n<li><samp>edit-filters.php</samp></li>\n</ul>\n<h4>Community Tickets</h4>\n<ul>\n<li><samp>tickets.php</samp></li>\n</ul>\n<h4>Community Events</h4>\n<p>Please take particular note of these changes. We have done a significant update to the views for Community Events and these views have been adjusted a lot to account for this.</p>\n<ul>\n<li><samp>edit-event.php</samp></li>\n<li><samp>edit-organizer.php</samp></li>\n<li><samp>edit-venue.php</samp></li>\n<li><samp>event-list.php</samp></li>\n<li><samp>modules/captcha.php</samp></li>\n<li><samp>modules/cost.php</samp></li>\n<li><samp>modules/custom.php</samp></li>\n<li><samp>modules/datepickers.php</samp></li>\n<li><samp>modules/header-links.php</samp></li>\n<li><samp>modules/image.php</samp></li>\n<li><samp>modules/organzier-fields.php</samp></li>\n<li><samp>modules/organizer.php</samp></li>\n<li><samp>modules/recurrence.php</samp></li>\n<li><samp>modules/taxonomy.php</samp></li>\n<li><samp>modules/venue.php</samp></li>\n<li><samp>modules/website.php</samp></li>\n</ul>\n<h4>Eventbrite</h4>\n<ul>\n<li><samp>eb-admin-notice.php</samp></li>\n<li><samp>eventbrite-events-table.php</samp></li>\n<li><samp>eventbrite-meta-box-extension.php</samp></li>\n</ul>\n<h4>Events Calendar PRO</h4>\n<ul>\n<li><samp>map/loop.php</samp></li>\n<li><samp>map/single-featured.php</samp></li>\n<li><samp>week/tooltip.php</samp></li>\n<li><samp>widgets/venue-widget.php</samp></li>\n<li><samp>widgets/modules/single-event.php</samp></li>\n</ul>\n<hr />\n<p>Thanks for your continued support! We have the best customers in the world. We hope thismakes your sites much better, your jobs way easier and your overall experience using our plugins a breeze. Cheers to you on behalf of everyone here at Modern Tribe!</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/things-to-be-aware-of-in-version-4-4-of-the-events-calendar-event-tickets-and-premium-add-ons/\">Things to Be Aware of in Version 4.4 of The Events Calendar, Event Tickets, and Premium Add-ons</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:36:\"\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:72:\"Release: The Events Calendar 4.4, Event Tickets 4.4, and Premium Add-ons\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:92:\"https://theeventscalendar.com/release-events-calendar-4-4-event-tickets-4-4-premium-add-ons/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 09 Jan 2017 22:23:13 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:8:\"Products\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:13:\"Release Notes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"https://theeventscalendar.com/?p=1213108\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:659:\"<p>We&#8217;re pleased to kick off the new year with a brand new feature release of The Events Calendar, Event Tickets, and a number of our premium add-ons. There are some truly awesome additions and improvements in this release that we think you&#8217;ll be quite stoked aboutwe can&#8217;tthink of a better way to start 2017! Heads&#8230;</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/release-events-calendar-4-4-event-tickets-4-4-premium-add-ons/\">Release: The Events Calendar 4.4, Event Tickets 4.4, and Premium Add-ons</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"George\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:6348:\"<p>We&#8217;re pleased to kick off the new year with a brand new feature release of The Events Calendar, Event Tickets, and a number of our premium add-ons. There are some truly awesome additions and improvements in this release that we think you&#8217;ll be quite stoked aboutwe can&#8217;tthink of a better way to start 2017!</p>\n<p>Heads up: This is a major update. As such, <strong>we strongly recommend that you test the new versions of our plugins in a safe development environment before installing them on a live site</strong>. New features means new code, and while we expect smooth sailing, there could be breaking changes. This is especially important for those of you whove added snippets, plugin extensions, template overrides, or modified the core templatesto the plugins.</p>\n<p>And, of course, please <a href=\"https://codex.wordpress.org/WordPress_Backups\" target=\"_blank\">backup your database and files</a> as you would before any other WordPress update.</p>\n<hr />\n<p> <strong>Please Note:</strong> Due to a small bug that arose after publishing the 4.4 version of our plugins, we have published versions 4.4.0.1 of The Events Calendar and Event Tickets. Please use version 4.4.0.1 of these two plugins.</p>\n<hr />\n<p>Ready to explore the details of this release? On to the changelogs!</p>\n<ul>\n<li><a href=\"#tec\">The Events Calendar 4.4.0.1</a></li>\n<li><a href=\"#ecp\">Events Calendar PRO 4.4</a></li>\n<li><a href=\"#comm\">Community Events 4.4</a></li>\n<li><a href=\"#comm-tix\">Community Tickets 4.4</a></li>\n<li><a href=\"#eb\">Eventbrite Tickets 4.4</a></li>\n<li><a href=\"#filter\">Filter Bar 4.4</a></li>\n<li><a href=\"#et\">Event Tickets 4.4.0.1</a></li>\n<li><a href=\"#etp\">Event Tickets Plus 4.4</a></li>\n<li><a href=\"#not-updated\">Not Updated in This Release</a></li>\n</ul>\n<hr />\n<h3 id=\"tec\">The Events Calendar 4.4.0.1</h3>\n<p><strong>Feature</strong>  Add dynamic helper text to single event editor to display the event&#8217;s date and time<br />\n<strong>Feature</strong>  Add support for featured events<br />\n<strong>Feature</strong>  Add support for placing the main events archive on the site homepage<br />\n<strong>Tweak</strong>  Adjusted styles and added actions for featured events in the List Widget<br />\n<strong>Tweak</strong>  Organizers and Venues are now with a better and cleaner interface<br />\n<strong>Fix</strong>  Add a link to The Events Calendar Help page in the Network Administration screen of multisite installations<br />\n<strong>Fix</strong>  Multisite license editing and displaying consistency</p>\n<hr />\n<h3 id=\"ecp\">Events Calendar PRO 4.4</h3>\n<p><strong>Feature</strong>  Added the [tribe_event_inline] shortcode to allow rendering of single event data anywhere shortcodes are allowed!<br />\n<strong>Feature</strong>  Add support for featured events<br />\n<strong>Feature</strong>  Allow deleting recurrences and exclusions<br />\n<strong>Tweak</strong>  Consolidated and simplified the UI when creating recurring events</p>\n<hr />\n<h3 id=\"comm\">Community Events 4.4</h3>\n<p><strong>Tweak</strong>  Moved reCAPTCHA API key fields to new API Settings Tab<br />\n<strong>Tweak</strong>  Organizers and Venues are now with a better and cleaner interface</p>\n<hr />\n<h3 id=\"comm-tix\">Community Tickets 4.4</h3>\n<p><strong>Tweak</strong>  Brings the plugin up-to-date with changes made in Event Tickets<br />\n<strong>Tweak</strong>  Brings the plugin up-to-date with changes made in Community Events<br />\n<strong>Tweak</strong>  Transitioned the dropdown selectors to the same system used in the parent plugins<br />\n<strong>Tweak</strong>  Text and translation fixes</p>\n<hr />\n<h3 id=\"eb\">Eventbrite Tickets 4.4</h3>\n<p><strong>Fix</strong>  Avoid the duplication of Venues imported from EventBrite due to country information API change<br />\n<strong>Tweak</strong>  Add a &#8220;deauthorization&#8221; button to the API keys settings screen</p>\n<hr />\n<h3 id=\"filter\">Filter Bar 4.4</h3>\n<p><strong>Tweak</strong>  Added a filter to filter events by their featured state<br />\n<strong>Fix</strong>  Filter labels that were previously not translatable are now translatable</p>\n<hr />\n<h3 id=\"et\">Event Tickets 4.4.0.1</h3>\n<p><strong>Tweak</strong>  Added a tabbed view support for Attendeees and Ticket Orders<br />\n<strong>Tweak</strong>  Added the &#8220;Attendees&#8221; report column in admin lists of posts supporting tickets<br />\n<strong>Tweak</strong> Added a tabbed view support for Attendeees and Ticket Orders<br />\n<strong>Tweak</strong> Improve the Attendee Report header with improved layout and better labels<br />\n<strong>Tweak</strong> Adjust the layout of the attendee report screen<br />\n<strong>Fix</strong>  Help page is now accessible even if The Events Calendar is not active on the site</p>\n<hr />\n<h3 id=\"etp\">Event Tickets Plus 4.4</h3>\n<p><strong>Tweak</strong>  Update the WooCommerce Orders Tab with better descriptions and breakdown of tickets sold by order status<br />\n<strong>Tweak</strong>  Ensure the manage_stock property of EDD tickets is not false when tickets have no inventory left</p>\n<hr />\n<h3 id=\"apm\">Advanced Post Manager 4.4</h3>\n<p><strong>Tweak</strong>  Text domain modified to &#8220;advanced-post-manager&#8221; in line with plugin directory standards</p>\n<hr />\n<h3 id=\"not-updated\">Not Updated in This Release</h3>\n<p>The following plugins have <em>not</em> been updated this release and will remain at the version numbers specified here:</p>\n<ul>\n<li>GigPress 2.3.17</li>\n<li>iCal Importer 4.3  This plugin will only be receiving maintenance updates going forward. Read more <a href=\"https://theeventscalendar.com/knowledgebase/moving-to-event-aggregator/\" target=\"_blank\">here</a>.</li>\n<li>Facebook Importer 4.3  This plugin will only be receiving maintenance updates going forward. Read more <a href=\"https://theeventscalendar.com/knowledgebase/moving-to-event-aggregator/\" target=\"_blank\">here</a>.</li>\n</ul>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/release-events-calendar-4-4-event-tickets-4-4-premium-add-ons/\">Release: The Events Calendar 4.4, Event Tickets 4.4, and Premium Add-ons</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:36:\"\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:88:\"Maintenance Release: The Events Calendar 4.3.5, Event Tickets 4.3.5, and Premium Plugins\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:116:\"https://theeventscalendar.com/maintenance-release-the-events-calendar-4-3-5-event-tickets-4-3-5-and-premium-plugins/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 20 Dec 2016 22:20:16 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:8:\"Products\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:13:\"Release Notes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"https://theeventscalendar.com/?p=1208469\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:733:\"<p>Today we&#8217;re happy to announce the fifth Maintenance Release of the 4.3 release cycle. Maintenance Releases are smaller updates between major updates that are mostly comprised of bug fixes, tweaks, and small but meaningful improvements. This maintenance release features a number of fixes to our plugins ahead of our forthcoming Feature Release, version 4.4, which&#8230;</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/maintenance-release-the-events-calendar-4-3-5-event-tickets-4-3-5-and-premium-plugins/\">Maintenance Release: The Events Calendar 4.3.5, Event Tickets 4.3.5, and Premium Plugins</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"George\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:5569:\"<p>Today we&#8217;re happy to announce the fifth Maintenance Release of the 4.3 release cycle. <a href=\"https://theeventscalendar.com/release-schedule/\" target=\"_blank\">Maintenance Releases</a> are smaller updates between major updates that are mostly comprised of bug fixes, tweaks, and small but meaningful improvements.</p>\n<p>This maintenance release features a number of fixes to our plugins ahead of our forthcoming Feature Release, version 4.4, which is just around the corner. Stay tuned to this blog or <a href=\"https://confirmsubscription.com/h/r/F35BA2B75B521339\" target=\"_blank\">subscribe to our newsletter</a> to learn when the 4.4 release is live!</p>\n<p>To see all of the changes included this Maintenance Release, check out the changelogs for all updated plugins below:</p>\n<ul>\n<li><a href=\"#tec\">The Events Calendar 4.3.5</a></li>\n<li><a href=\"#ecp\">Events Calendar PRO 4.3.4</a></li>\n<li><a href=\"#et\">Event Tickets 4.3.5</a></li>\n<li><a href=\"#etp\">Event Tickets Plus 4.3.5</a></li>\n<li><a href=\"#eb\">Eventbrite Tickets 4.3.3</a></li>\n<li><a href=\"#fb\">Filter Bar 4.3.4</a></li>\n<li><a href=\"#ce\">Community Events 4.3.2</a></li>\n<li><a href=\"#ct\">Community Tickets 4.3.2</a></li>\n<li><a href=\"#not-updated\">Not Updated This Release</a></li>\n</ul>\n<hr />\n<h3 id=\"tec\">The Events Calendar 4.3.5</h3>\n<ul>\n<li><strong>Tweak</strong>   Updated the template override instructions in a number of templates</li>\n<li><strong>Tweak</strong>   Improve behaviour of tribe_get_events_title() in respect of single events</li>\n<li><strong>Tweak</strong>   Event Aggregator will only load on the Administration, prevent bigger loads for Front-End users</li>\n<li><strong>Tweak</strong>   Allow better filtering for Organizers and Venue Meta fields (Props: @Chouby from Polylang)</li>\n<li><strong>Fix</strong>  Prevent JavaScript Notices related to Bumpdown</li>\n<li><strong>Fix</strong>  Assets URL on Windows Servers are fully operational again</li>\n<li><strong>Fix</strong>  JavaScript and CSS files will respect HTTPS on all pages</li>\n<li><strong>Fix</strong>  Fixed comment count and visibility issues due to Event Aggregator records</li>\n<li><strong>Fix</strong>  Fixed PHP notices and warnings raised when importing .ics files</li>\n<li><strong>Fix</strong>  Only show link to Venues if Pro is active in List View</li>\n<li><strong>Fix</strong>  Fixed and issue that would make Event Aggregator importing notices remain stuck in the Import screen</li>\n<li><strong>Fix</strong>  Avoid error screen when saving licenses on multisite installations</li>\n<li><strong>Fix</strong>  Fix calendar view links in WPML language switcher</li>\n</ul>\n<hr />\n<h3 id=\"ecp\">Events Calendar PRO 4.3.4</h3>\n<ul>\n<li><strong>Fix</strong>  Taxonomy selections not saving for widgets by checking for a variable and setting a default</li>\n<li><strong>Tweak</strong>  Updated the template override instructions in a number of templates</li>\n</ul>\n<hr />\n<h3 id=\"et\">Event Tickets 4.3.5</h3>\n<ul>\n<li><strong>Tweak</strong>  Updated the template override instructions in a number of templates</li>\n<li><strong>Tweak</strong>  Allow better filtering for Attendees (Props to @jtsternberg)</li>\n<li><strong>Fix</strong>  Prevent JavaScript Notices related to Bumpdown</li>\n<li><strong>Fix</strong>  Assets URL on Windows Servers are fully operational again</li>\n<li><strong>Fix</strong>  JavaScript and CSS files will respect HTTPS on all pages</li>\n</ul>\n<hr />\n<h3 id=\"etp\">Event Tickets Plus 4.3.5</h3>\n<ul>\n<li><strong>Tweak</strong>  Updated the template override instructions in a number of templates</li>\n<li><strong>Fix</strong>  Prevent EDD from throwing fatals on Price HTML methods</li>\n<li><strong>Fix</strong>  Update order-autocompletion logic to work with current versions of WooCommerce</li>\n</ul>\n<hr />\n<h3 id=\"eb\">Eventbrite Tickets 4.3.3</h3>\n<ul>\n<li><strong>Tweak</strong>  Updated the template override instructions in a number of template</li>\n</ul>\n<hr />\n<h3 id=\"fb\">Filter Bar 4.3.4</h3>\n<ul>\n<li><strong>Tweak</strong>  Updated the template override instructions in a number of templates</li>\n<li><strong>Tweak</strong>  Removes checks for legacy custom field data which are no longer required in most cases, providing a moderate performance boost</li>\n</ul>\n<hr />\n<h3 id=\"ce\">Community Events 4.3.2</h3>\n<ul>\n<li><strong>Tweak</strong>  Updated the template override instructions in a number of templates</li>\n</ul>\n<hr />\n<h3 id=\"ct\">Community Tickets 4.3.2</h3>\n<ul>\n<li><strong>Tweak</strong>  Updated the template override instructions in a number of templates</li>\n</ul>\n<hr />\n<h3 id=\"not-updated\">Not Updated This Release</h3>\n<p>The following plugins have <em>not</em> been updated this release and will remain at the version numbers specified here:</p>\n<ul>\n<li>Advanced Post Manager 4.3.1</li>\n<li>GigPress 2.3.17</li>\n<li>iCal Importer 4.2.5 (<a href=\"https://theeventscalendar.com/knowledgebase/moving-to-event-aggregator/\" target=\"_blank\">read more</a>)</li>\n<li>Facebook Importer 4.2.5 (<a href=\"https://theeventscalendar.com/knowledgebase/moving-to-event-aggregator/\" target=\"_blank\">read more</a>)</li>\n</ul>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/maintenance-release-the-events-calendar-4-3-5-event-tickets-4-3-5-and-premium-plugins/\">Maintenance Release: The Events Calendar 4.3.5, Event Tickets 4.3.5, and Premium Plugins</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:36:\"\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:43:\"Hotfix Release: The Events Calendar 4.3.4.2\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:69:\"https://theeventscalendar.com/hotfix-release-events-calendar-4-3-4-2/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 13 Dec 2016 20:10:20 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:8:\"Products\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:13:\"Release Notes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"https://theeventscalendar.com/?p=1205342\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:619:\"<p>Weve just released an update to The Events Calendar to address an issue that some folks encountered after updating to the Maintenance Release we released last week. The issue, while stemming from code within The Events Calendar, actually effects users of Events Calendar Pro: the /all/ page for recurring events was essentially broken. The only&#8230;</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/hotfix-release-events-calendar-4-3-4-2/\">Hotfix Release: The Events Calendar 4.3.4.2</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"George\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1117:\"<p>Weve just released an update to The Events Calendar to address an issue that some folks encountered after updating to <a href=\"https://theeventscalendar.com/maintenance-release-events-calendar-4-3-4-event-tickets-4-3-4-premium-plugins/\" target=\"_blank\">the Maintenance Release we released last week</a>.</p>\n<p>The issue, while stemming from code within The Events Calendar, actually effects users of Events Calendar Pro: the /all/ page for recurring events was essentially broken.</p>\n<p>The only plugins affected by this release are The Events Calendar which is now at version 4.3.4.2. To learn about the status of other plugins at this time, please consult our Maintenance Release notes from last week <a href=\"https://theeventscalendar.com/maintenance-release-events-calendar-4-3-4-event-tickets-4-3-4-premium-plugins/\" target=\"_blank\">here</a>.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/hotfix-release-events-calendar-4-3-4-2/\">Hotfix Release: The Events Calendar 4.3.4.2</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:36:\"\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:61:\"Hotfix Release: The Events Calendar and Event Tickets 4.3.4.1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:83:\"https://theeventscalendar.com/hotfix-release-events-calendar-event-tickets-4-3-4-1/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 09 Dec 2016 17:00:10 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:8:\"Products\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:13:\"Release Notes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"https://theeventscalendar.com/?p=1203977\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:628:\"<p>Weve just released an update to The Events Calendar and Event Tickets to address an issue that some folks encountered after updating to the Maintenance Release we just released yesterday. The issue is that there were two stray characters left in a main PHP file for both plugins. This may sound innocuous, but could cause&#8230;</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/hotfix-release-events-calendar-event-tickets-4-3-4-1/\">Hotfix Release: The Events Calendar and Event Tickets 4.3.4.1</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"George\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1700:\"<p>Weve just released an update to The Events Calendar and Event Tickets to address an issue that some folks encountered after updating to <a href=\"https://theeventscalendar.com/maintenance-release-events-calendar-4-3-4-event-tickets-4-3-4-premium-plugins/\" target=\"_blank\">the Maintenance Release we just released yesterday</a>.</p>\n<p>The issue is that there were two stray characters left in a main PHP file for both plugins. This may <em>sound</eM> innocuous, but could cause a number of issues of varying severity, so it&#8217;s important that we publish a correction of that mistake.</p>\n<p><strong>The only plugins affected by this release are The Events Calendar and Event Tickets</strong>, specifically, <strong>which are now at version 4.3.4.1</strong>. To learn about the status of other plugins at this time, please consult our Maintenance Release notes from yesterday <a href=\"https://theeventscalendar.com/maintenance-release-events-calendar-4-3-4-event-tickets-4-3-4-premium-plugins/\" target=\"_blank\">here</a>.</p>\n<hr />\n<p><img src=\"https://s.w.org/images/core/emoji/2.2.1/72x72/1f4e3.png\" alt=\"?\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> <strong>Enormous thanks</strong> to user <a href=\"https://github.com/Aetles\" target=\"_blank\">Adrian Bengtson</a>, who not only reported the issue but also submitted a Pull Request on GitHub that fixed the code. Thanks, Adrian!</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/hotfix-release-events-calendar-event-tickets-4-3-4-1/\">Hotfix Release: The Events Calendar and Event Tickets 4.3.4.1</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:36:\"\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:88:\"Maintenance Release: The Events Calendar 4.3.4, Event Tickets 4.3.4, and Premium Plugins\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:108:\"https://theeventscalendar.com/maintenance-release-events-calendar-4-3-4-event-tickets-4-3-4-premium-plugins/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 08 Dec 2016 21:06:35 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:8:\"Products\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:13:\"Release Notes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"https://theeventscalendar.com/?p=1202576\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:720:\"<p>Today we&#8217;re happy to announce the fourth Maintenance Release of the 4.3 release cycle. Maintenance Releases are smaller updates between major updates that are mostly comprised of bug fixes, tweaks, and small but meaningful improvements. This maintenance release is fairly limited in scope, as a major Feature Release is just around the cornerstay tuned to&#8230;</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/maintenance-release-events-calendar-4-3-4-event-tickets-4-3-4-premium-plugins/\">Maintenance Release: The Events Calendar 4.3.4, Event Tickets 4.3.4, and Premium Plugins</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"George\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3218:\"<p>Today we&#8217;re happy to announce the fourth Maintenance Release of the 4.3 release cycle. <a href=\"https://theeventscalendar.com/release-schedule/\" target=\"_blank\">Maintenance Releases</a> are smaller updates between major updates that are mostly comprised of bug fixes, tweaks, and small but meaningful improvements.</p>\n<p>This maintenance release is fairly limited in scope, as a major Feature Release is just around the cornerstay tuned to this blog or <a href=\"https://confirmsubscription.com/h/r/F35BA2B75B521339\" target=\"_blank\">subscribe to our newsletter</a> to learn when the next Feature Release is live!</p>\n<p>To see all of the changes included this Maintenance Release, check out the changelogs for all updated plugins below:</p>\n<ul>\n<li><a href=\"#tec\">The Events Calendar 4.3.4</a></li>\n<li><a href=\"#et\">Event Tickets 4.3.4</a></li>\n<li><a href=\"#etp\">Event Tickets Plus 4.3.4</a></li>\n<li><a href=\"#eb\">Eventbrite Tickets 4.3.2</a></li>\n<li><a href=\"#not-updated\">Not Updated This Release</a></li>\n</ul>\n<hr />\n<h3 id=\"tec\">The Events Calendar 4.3.4</h3>\n<ul>\n<li><strong>Tweak</strong>  Tribe Common is now loaded only once across our plugin suite, which improves performance in some cases</li>\n<li><strong>Fix</strong> (Event Aggregator)  Fixed an issue where Facebook featured images would not be set on import</li>\n<li><strong>Fix</strong> (Event Aggregator)  Google Calendar and iCalendar files are now updating their respective events</li>\n<p>	<!--\n\n<li><strong>Fix</strong> (Event Aggregator)  On-demand Event Aggregator records will update events correctly</li>\n\n-->\n</ul>\n<hr />\n<h3 id=\"et\">Event Tickets 4.3.4</h3>\n<ul>\n<li><strong>Tweak</strong>  Tribe Common is now loaded only once across our plugin suite, which improves performance in some cases</li>\n</ul>\n<hr />\n<h3 id=\"etp\">Event Tickets Plus 4.3.4</h3>\n<ul>\n<li><strong>Fix</strong>  Fieldset admin menu now shows correctly when only Event Tickets is active</li>\n</ul>\n<hr />\n<h3 id=\"eb\">Eventbrite Tickets 4.3.2</h3>\n<ul>\n<li><strong>Fix</strong>  Resolved issue where bad website data was added to Organizers when syncing to Eventbrite without Events Calendar PRO active.</li>\n</ul>\n<hr />\n<h3 id=\"not-updated\">Not Updated This Release</h3>\n<p>The following plugins have <em>not</em> been updated this release and will remain at the version numbers specified here:</p>\n<ul>\n<li>Events Calendar Pro 4.3.3</li>\n<li>Filter Bar 4.3.3</li>\n<li>Advanced Post Manager 4.3.1</li>\n<li>Community Events 4.3.1</li>\n<li>Community Tickets 4.3.1</li>\n<li>GigPress 2.3.17</li>\n<li>iCal Importer 4.2.5 (<a href=\"https://theeventscalendar.com/knowledgebase/moving-to-event-aggregator/\" target=\"_blank\">read more</a>)</li>\n<li>Facebook Importer 4.2.5 (<a href=\"https://theeventscalendar.com/knowledgebase/moving-to-event-aggregator/\" target=\"_blank\">read more</a>)</li>\n</ul>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/maintenance-release-events-calendar-4-3-4-event-tickets-4-3-4-premium-plugins/\">Maintenance Release: The Events Calendar 4.3.4, Event Tickets 4.3.4, and Premium Plugins</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}s:27:\"http://www.w3.org/2005/Atom\";a:1:{s:4:\"link\";a:1:{i:0;