:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:776:\"<h1>Terzo WordPress Meetup di Avezzano!</h1>\n<p>L&#8217;appuntamento <strong>Luned 13 Febbraio alle18.00, alBar Tonalit</strong> (via Saturnini,6,Avezzano).</p>\n<h2>Programma</h2>\n<p>Proponiamo una breve presentazione su come creare una galleria di immagini che proseguir con un momento per le domande.</p>\n<p>Dopodich, abbiamo pensato di dedicare del tempo per chiacchierare liberamente. In cui vogliamo dare la possibilit di conoscerci meglio e sentirsi liberi di togliersi qualche dubbio.</p>\n<h2>Come partecipare</h2>\n<p>L&#8217;incontro  a ingresso libero e gratuito per chiunque sia interessato:<a href=\"https://www.meetup.com/it-IT/WordPress-Meetup-Avezzano/events/237526930/\" target=\"_blank\">basta iscriversi all&#8217;evento su Meetup</a></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"https://it.wordpress.org/news/2017/02/meetup-avezzano-13-febbraio-2017/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:45:\"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Meetup Padova: 22 Febbraio 2017\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:69:\"https://it.wordpress.org/news/2017/02/meetup-padova-22-febbraio-2017/\";s:7:\"attribs\";a:0:{}s:8:\"xm