o di Febbraio della community WordPress padovana  fissato per<strong>Mercoled 22 Febbraio alle 19, presso TalentLab</strong>(via Monselice 15/a, Padova)</p>\n<h2>Programma dell&#8217;incontro</h2>\n<ul>\n<li><strong>Accelerated Mobile Pages (AMP):</strong> conosciamo il progetto che mira a migliorare le prestazioni mobile, e scopriamo come integrare funzionalit AMP con WordPress.</li>\n<li><strong>AdWords e Google Web Designer:</strong> impariamo a gestire campagne pubblicitarie con annunci responsive, adattabili a tutti i dispositivi, grazie agli ultimi strumenti per web marketing e design.</li>\n</ul>\n<h2>Per partecipare</h2>\n<p>Non devi fare altro che<a href=\"https://www.meetup.com/it-IT/Padova-WordPress-Meetup/events/237518799/\" target=\"_blank\">iscriverti all&#8217;evento su Meetup</a>! La partecipazione  libera e aperta a tutti.</p>\n<p>Ti aspettiamo!</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"https://it.wordpress.org/news/2017/02/meetup-padova-22-febbraio-2017/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:45:\"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"Meetup Treviso: 16 Febbraio 2017\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:70:\"https://it.wordpress.org/news/2017/0