:{i:0;a:5:{s:4:\"data\";s:1501:\"<h1>Treviso, e tre!</h1>\n<p>Terzo appuntamento della community diTreviso<strong>Gioved16 Febbraiodalle 19</strong><strong>, presso Barchessa Foscarini &#8211;Piazza XI Febbraio,Castello di Godego (TV)</strong></p>\n<h2>Programma</h2>\n<ul>\n<li><strong>Il calendario dell&#8217;avvento con le WP-API</strong><br />\nCome  stato costruito il calendario dell&#8217;avvento online utilizzando le API di WordPress e quali vantaggi ha portato.</li>\n<li><strong>Email dal blog: evitare il disastro<br />\n</strong>Le email sono un elemento chiave di molti business ed  importante che arrivino a destinazione.Ogni sito spedisce email, da quella di registrazione alla notifica di nuovi commenti, dalla conferma di acquisto al quella di recupero password, da una newsletter ai messaggi di un modulo contatti.Ma non sempre arrivano.Come vengono spedite le email da WP e perch hanno sempre tanti problemi di deliverability? Come li risolviamo? Quanto ci costa?In modo semplice anche per i non tecnici.</li>\n</ul>\n<h2>Per partecipare</h2>\n<p><a href=\"https://www.meetup.com/it-IT/Treviso-WordPress-Meetup/events/237519427/\">Iscriviti all&#8217;evento su meetup.com.</a><br />\nGli incontri sono liberi e gratuiti, sei il benvenuto se utilizzi WordPress per la tua attivit, se sei un developer, se sei un freelance, se sei un designer, se sei un marketer,<strong>o se semplicemente vuoi saperne di pi</strong>sulla piattaforma pi utilizzata al mondo per creare siti internet.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:75:\"https://it.wordpress.org/news/2017/02/meetup-treviso-16-febbraio-2017/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"